import './Banner.css';
import './Social.css';

function Banner() {
    return (
    

    
    
        <div className="site-banner">
            <img className="center"src="https://img.icons8.com/ios/50/000000/twitter.png"/>
            
        <h1 className="site-banner-title">JY <br></br> MEDIA MARKETING</h1>
            </div>
      
      
    );
  }
  export default Banner;
